            <div className='contatos-flex'>
                <div className='contact'> 
                <h1>

                </h1>
                <ul>
                    <li>Nova Iguaçu, RJ</li>
                    <li>(21) 9999-9999</li>
                    <li></li>
                </ul>
                </div>


                <div className='contact'> </div>

             </div>

            </div>
        </section>

     );
}

export default Contact ;
